import React, { Component } from "react";

class Register extends Component {
  render() {
    return (
      <div>
        <h3>LOGIN</h3>
        <Container>
          <TextField
            style={{ width: 500 }}
            label="Email"
            margin="dense"
            variant="outlined"
          />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Passworld"
            margin="dense"
            variant="outlined"
            type="password"
          />
          <br />
          <Button
            style={{
              width: 500,
              marginTop: 50,
              background: "yellow",
              color: "black"
            }}
          >
            LOGIN
          </Button>
        </Container>
      </div>
    );
  }
}

export default Register;
